
<!DOCTYPE html>
<html>
<head>
    <title>Inkscape Output</title>
</head>
<body>

    <canvas id='canvas' width='300' height='300'></canvas>
    <script>
    var ctx = document.getElementById("canvas").getContext("2d");
    	
// #Слой_8
	ctx.save();
	ctx.transform(1.000000, 0.000000, 0.000000, 1.000000, -14.200000, -22.211100);
	
// #polygon2050
	ctx.beginPath();
	ctx.strokeStyle = 'rgb(0, 0, 0)';
	ctx.moveTo(74.800000, 43.900000);
	ctx.lineTo(74.800000, 23.100000);
	ctx.lineTo(61.400000, 31.000000);
	ctx.lineTo(61.400000, 38.100000);
	ctx.stroke();
	
// #line2052
	ctx.beginPath();
	ctx.strokeStyle = 'rgb(0, 0, 0)';
	ctx.moveTo(98.099998, 33.299999);
	ctx.lineTo(74.800003, 33.299999);
	ctx.stroke();
	
// #line2054
	ctx.beginPath();
	ctx.strokeStyle = 'rgb(0, 0, 0)';
	ctx.moveTo(14.200000, 33.299999);
	ctx.lineTo(41.000000, 33.299999);
	ctx.stroke();
	
// #polyline2056
	ctx.beginPath();
	ctx.strokeStyle = 'rgb(0, 0, 0)';
	ctx.moveTo(61.400000, 38.100000);
	ctx.lineTo(54.000000, 38.100000);
	ctx.lineTo(54.000000, 31.000000);
	ctx.lineTo(61.400000, 31.000000);
	ctx.stroke();
	
// #polyline2058
	ctx.beginPath();
	ctx.strokeStyle = 'rgb(0, 0, 0)';
	ctx.moveTo(54.000000, 38.100000);
	ctx.lineTo(41.000000, 43.900000);
	ctx.lineTo(41.000000, 23.100000);
	ctx.lineTo(54.000000, 31.000000);
	ctx.stroke();
	ctx.restore();

    </script>
</body>
</html>
